import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import AcUnitIcon from '@material-ui/icons/AcUnit';
import Avatar from '@material-ui/core/Avatar';
import {Link} from 'react-router-dom';
import {BrowserRouter} from 'react-router-dom';
import {IconButton} from '@material-ui/core';
import clsx from 'clsx';
import {Drawer} from '@material-ui/core';
import {CssBaseline} from '@material-ui/core';
import {Divider} from '@material-ui/core';
import {MenuIcon} from '@materail-ui/core';
import {ChevronLeftIcon} from '@material-ui/core';
import {ListItem} from '@material-ui/core';
import {ListItemIcon} from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
    },
    menuButton: {
      marginRight: theme.spacing(2),
    },
    title: {
      flexGrow: 1,
    },
    rooted: {
        display: 'flex',
        '& > *': {
          margin: theme.spacing(1),
        },
      },
      small: {
        width: theme.spacing(3),
        height: theme.spacing(3),
      },
  }));
 
const drawerWidth = 240;

const Nav = () =>{
    const classes = useStyles();
    const [mobileOpen, setMobileOpen] = React.useState(false);

    const handleDrawerToggle = () =>{
      setMobileOpen(!mobileOpen);
    }

    const drawer = (
      <div>
        <div className={classes.toolbar} />
        <Divider />
          <List>
            {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
              <ListItem button key={text}>
                <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
                <ListItemText primary={text} />
              </ListItem>
            ))}
          </List>
        <Divider />
        <List>
          {['All mail', 'Trash', 'Spam'].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </div>
    );

    return (
        <div className={classes.root}>
          <AppBar position="static">
            <Toolbar>
              <IconButton
              color="inherit"
              aria-label="open drawer"
              onClick={handleDrawerOpen}
              edge="start"
              className={clsx(classes.menuButton, open && classes.hide)}
              >
              <MenuIcon />
              </IconButton>
              <AcUnitIcon/>
              <Typography variant="h6" className={classes.title}>
                Life
              </Typography>
                <BrowserRouter>
                  <Button component={Link} to='/'>Home</Button>
                  <Button component={Link} to='/discussion'>Discussion</Button>
                  <Button component={Link} to='/groupmanager'>Project Manager</Button>
                  <Button component={Link} to='/login'>Login</Button>
                </BrowserRouter> 
              <Button><Avatar className={classes.small}alt="Remy Sharp" src="/static/images/avatar/1.jpg" /></Button>
            </Toolbar>
          </AppBar>
        </div>
      );
    
}
export default Nav
